/*
Epic Typical HL7 Conversion Data Requirements
Required
	PID-3: Patient Identifiers
	ORC-1: Control Code - "RE" for Result on converted data
	OBR-3: Filler Order ID - Used to uniquely identify results
	OBR-4: Procedure ID
	OBR-7: Observation Date/Time
	OBR-16: Ordering Provider 
	OBR-22: Results Report/Status 
Change
	OBR-25: Result Status
	OBX-2: Data Type
	OBX-3: Observation ID
	OBX-5: Observation Value
	OBX-8: Abnormal Flag â€“ Used to flag abnormal results where appropriate for the result
	OBX-11: Observation Result Status â€“Required if converted results will be used with Health Maintenance

Highly Recommended
	PID-5: Patient Name 
	PID-7: Date of birth 
	PID-8: Sex 
	PID-18/PV1-19: Patient Visit ID - Used to link the result back to an encounter
	PID-19: SSN 
	OBX-6: Units â€“ Where appropriate for the result
	OBX-7: Reference Range - Where appropriate for the result

Nice to Have
	PV1-3: Patient Location â€“ Used if creating an encounter rather than matching to a converted historical encounter
	OBR-15: Specimen Type/Source

Additional Notes
For pathology reports, the case number, rather than the specimen ID, should appear in OBR-3. 
Multiple specimens can correspond to a single case and if a report is sent for each specimen, 
you could receive duplicate reports. End users are able to look up patients by case number, so 
filing the case number in OBR-3 is useful for pathologists and other end users when looking up 
converted cases.

*/

